    false,nt"url": null,nt"notes": "The Northern Tallgrass Prairie is an endangered
    ecosystem, and in turn, grassland dependent birds and some forbs are in serious
    peril. The Grassland Management Plan (GMP) was developed in response to the Habitat
    and Wildlife Management Goal and the degrading grassland habitat of Union Slough
    NWR. The GMP has the following objectives; preserve remnant tallgrass prairie and
    associated threatened or endangered species, restore and preserve a grassland buffer
    around refuge wetlands, restore and preserve a complex of wetlands, wet meadows,
    and uplands for breeding waterfowl and other area-sensitive grassland birds, and
    restore and protect a buffer around lower Buffalo Creek.",nt"license_title":
